let districts = null;
let spacing = 0;
function generateDistricts(){
  districts = {};
  // let ranges = mooncatDistricts;
  let keys = Object.keys(ranges);
  let lookup = {};
  keys.forEach((key)=>{
    let rangeIndex = Math.floor(ranges[key].xMin/spacing);
    if(lookup[rangeIndex] == null){
      lookup[rangeIndex] = {};
    }
    lookup[rangeIndex][key] = ranges[key];
  })
  
  mooncats.forEach((mooncat) => {
    let districtKey = (mooncat.saturation == 'Pale' ? mooncat.saturation + '_' : '') +
                        mooncat.hue + '_' + 
                        mooncat.pattern;
    if(mooncat.hue == 'Black' || mooncat.hue == 'White'){
      districtKey = 'Genesis';
    }
    if(districts[districtKey] == null){
      districts[districtKey] = [];
      // districtsIndex[districtKey] = 1;
    }
    let index = districts[districtKey].length;
    districts[districtKey].push({
      mooncat,
      range: ranges[districtKey].parcels[index]
    });
  })
}

function findParcel(moonCatId){
  if(!districts){
    generateDistricts();
  }

  let keys = Object.keys(districts);
  let range = null;
  keys.every((key)=>{
    let district = districts[key];
    district.every((parcel)=>{
      if(parcel.mooncat.index == moonCatId){
        range = parcel.range;
        return false;
      } else {
        return true;
      }
    })
    if(range){
      return false
    } else {
      return true;
    }
  })
  return range;
}

class LessCrappyMinecraftAttempt {
  constructor() {
    this._Initialize();
  }

  _Initialize() {
    this.entityManager_ = new entity_manager.EntityManager();

    this.LoadControllers_();

    this.previousRAF_ = null;
    this.RAF_();
  }

  CreateGUI_() {
    this._guiParams = {
      general: {
      },
    };
    this._gui = new GUI();
    this._gui.close();
  }

  LoadControllers_() {
    const threejs = new entity.Entity();
    threejs.AddComponent(new threejs_component.ThreeJSController());
    this.entityManager_.Add(threejs, 'renderer');

    // Hack
    this.renderer_ = threejs.GetComponent('ThreeJSController');
    this.scene_ = threejs.GetComponent('ThreeJSController').scene_;
    this.camera_ = threejs.GetComponent('ThreeJSController').camera_;
    this.threejs_ = threejs.GetComponent('ThreeJSController').threejs_;
    
    const voxelManager = new entity.Entity();
    voxelManager.AddComponent(new sparse_voxel_cell_manager.SparseVoxelCellManager({
        cellSize: hack_defs.WORLD_BLOCK_SIZE,
        worldSize: hack_defs.WORLD_SIZE,
    }));
    this.entityManager_.Add(voxelManager, 'voxels');

    const clouds = new entity.Entity();
    clouds.AddComponent(new cloud_controller.CloudController());
    this.entityManager_.Add(clouds);

    const player = new entity.Entity();
    player.AddComponent(new player_controller.PlayerController());
    player.AddComponent(new voxel_tools.VoxelTools_Insert());
    player.AddComponent(new voxel_tools.VoxelTools_Delete());

    var url_string = window.location.href;
    var url = new URL(url_string);
    var moonCatId = url.searchParams.get("id");
    if(moonCatId){
      console.log('MoonCat ID: ', moonCatId);
      let parcel = findParcel(parseInt(moonCatId));
      player.SetPosition(new THREE.Vector3(...[parcel.xMin,0,parcel.zMin]));
    } else {
      player.SetPosition(new THREE.Vector3(...defs.PLAYER_POS));
    }



    
    player.SetQuaternion(new THREE.Quaternion(...defs.PLAYER_ROT));

    this.entityManager_.Add(player, 'player');

    const ui = new entity.Entity();
    ui.AddComponent(new ui_controller.UIController());
    this.entityManager_.Add(ui, 'ui');
  }

  RAF_() {
    requestAnimationFrame((t) => {
      if (this.previousRAF_ === null) {
        this.previousRAF_ = t;
      }

      this.Step_(t - this.previousRAF_);
      this.renderer_.Render();
      this.previousRAF_ = t;

      setTimeout(() => {
        this.RAF_();
      }, 1);
    });
  }

  Step_(timeElapsed) {
    const timeElapsedS = Math.min(1.0 / 30.0, timeElapsed * 0.001);

    this.entityManager_.Update(timeElapsedS);
  }
}


